import React from "react";

export const GridItem = ({ key, title, text }) => {
  return (
    <div key={key} className="bg-white border border-gray-300 flex flex-col items-center justify-center text-lg draggable-handle text-balance">
      <h5>{title}</h5>
      <h3 className="p-2 text-balance">{text}</h3>
    </div>
  );
};

export const GridItemWithImage = ({ key, title, text, image, alt }) => {
  return (
    <div key={key} className="bg-white border border-gray-300 flex flex-col items-center justify-center text-lg draggable-handle">
      <img src={image} alt={alt} className="mb-2" />
      <h5>{title}</h5>
      <span className="p-2 text-clip">{text}</span>
    </div>
  );
};
